import { createTheme, ThemeProvider } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import LeaderboardIcon from '@mui/icons-material/Leaderboard';
import AnalyticsIcon from '@mui/icons-material/Analytics';
import UploadIcon from '@mui/icons-material/Upload';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import Avatar from '@mui/material/Avatar'; // Import the Avatar component
import deepRacerLogo from '../assets/deepracer.png'; // Import the image
import rmitLogo from '../assets/rmit.png'

const drawerWidth = 240;
const theme = createTheme({
  typography: {
    h6: {
      fontWeight: 1, // Replace 'YourCustomFont' with the name of your font family
    },
  },
});
export default function Sidenav() {
  return (
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
            backgroundColor:'#1A1A1A',
            color:'#FF9900'
          },
        }}
        variant="permanent"
        anchor="left"
      >

        <Box alignItems="center">
          <Avatar alt="RMIT Logo" src={rmitLogo} variant = 'square' sx={{width:200, height:70, paddingLeft: 2}}/>
          <Avatar alt="DeepRacer logo" src={deepRacerLogo} variant = 'square'  sx={{width: 120, height:100, paddingLeft: 6, paddingTop: 2}}/>
        </Box>
        <List>
          {/* Accounts Icon */}
          <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon sx={{color:'#FF9900'}}>
                <AccountCircleIcon />
              </ListItemIcon>
              <ListItemText primary="Accounts" />
            </ListItemButton>
          </ListItem>
        </List>
        <Divider />
        <List>
            <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon sx={{ color: '#FF9900' }}>
                <LeaderboardIcon />
              </ListItemIcon>
              <ListItemText primary="Leaderboard" />
            </ListItemButton>
          </ListItem>

          <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon sx={{ color: '#FF9900' }}>
                <AnalyticsIcon />
              </ListItemIcon>
              <ListItemText primary="Statistics" />
            </ListItemButton>
          </ListItem>

          <ListItem disablePadding>
            <ListItemButton>
              <ListItemIcon sx={{ color: '#FF9900' }}>
                <UploadIcon/>
              </ListItemIcon>
              <ListItemText primary="Upload" />
            </ListItemButton>
          </ListItem>
        </List>
        <Divider />
        <List>
          {['All mail', 'Trash', 'Spam'].map((text, index) => (
            <ListItem key={text} disablePadding>
              <ListItemButton>
              <ListItemIcon sx={{color:'#FF9900'}}>
                  {index % 2 === 0 ? <LeaderboardIcon /> : <AnalyticsIcon />}
                </ListItemIcon>
                <ListItemText primary={text} />
              </ListItemButton>
            </ListItem>
          ))}
        </List>
      </Drawer> 
  );
}
